const SideDrawer = ({show, click}) => {
  const sideDrawerClass = ["sidedrawer"]

  if(show) {
    sideDrawerClass.push("show");
  }
  return  <div className={sideDrawerClass.join(" ")}>
      <ul className="sidedrawer-links" onClick={click}>
        
      </ul>

  </div>
  
};

